import React from 'react'
import Layout from '../components/Layout'
import Detail from '../components/detail/Detail'
import Comment from '../components/comment/Comment'

const DetailTodo = () => {
  return (
    <div>
        <Layout/>
        <Detail/>
          <Comment/>
    </div>
  )
}

export default DetailTodo;
